#define GREY 0xDEDB	//11011|110110|11011
#define HIGHLIGHT 0xF7EC

#define RED 0xF821
#define BLU 0x65DF
#define PUR 0xC31F
#define YEL 0xFFE4
#define GRE 0x5FEA
#define PNK 0xFBD6
#define ORA 0xFB68
#define TEA 0x07FD

#define FPGA_CHAR_BASE        0xC9000000

volatile int pixel_buffer_start; // global variable
volatile int * PS2_ptr = (int*) 0xFF200100;	//PS2 port address
const short int winscreen3_map[];

void disable_A9_interrupts (void);
void set_A9_IRQ_stack (void);
void config_GIC (void);
void config_KEYs (void);
void enable_A9_interrupts (void);
short int numToColor(int num);
void check_win();
/* These global variables are written by interrupt service routines; we have to declare these as volatile
* to avoid the compiler caching their values in registers */
extern volatile int key_pressed = 4; // stores a KEY value when pressed (4 = NONE)

volatile int board[8][8] = {
  {0, 1, 0, 0, 0, 0, 0, 2},
  {0, 3, 0, 0, 0, 0, 4, 0},
  {0, 0, 0, 0, 5, 0, 6, 0},
  {0, 0, 0, 6, 0, 0, 2, 0},
  {0, 0, 0, 1, 7, 0, 0, 0},
  {0, 3, 4, 0, 0, 0, 7, 0},
  {0, 0, 0, 0, 5, 0, 0, 0},
  {8, 0, 0, 0, 0, 0, 0, 8}
};
extern volatile int gw = 50,startx, starty, curx, cury;
volatile int bool_selected = 0, bool_won = 0, current_color;

int main(void)
{
  volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
  volatile int * sw_ptr = (int *)0xFF200040; //switch address
	disable_A9_interrupts (); // disable interrupts in the A9 processor
	set_A9_IRQ_stack (); // initialize the stack pointer for IRQ mode
	config_GIC (); // configure the general interrupt controller
	config_KEYs (); // configure KEYs to generate interrupts
	enable_A9_interrupts (); // enable interrupts in the A9 processor

//	config_KEYs (); 									// configure pushbutton KEYs to generate interrupts

	enable_A9_interrupts (); 			// enable interrupts in the A9 processor

	int curr_col = 0;
	int curr_row = 0;
	int display = 1;
	int valid_path[8] = {0};	//This array holds 1 if a full start -> finish has
								//been completed for the indexed colour
	int win = 0;

    // initialize positions (NOT DONE)
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

	clear_screen();
	draw_grid();		//Draw the grid on the first buffer
	for (int i = 0; i<8; i++){
    for (int j = 0; j<8; j++){
      if (board[i][j]> 0)draw_circle(i, j, numToColor(board[i][j]));}}

	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	clear_screen();
	draw_grid();		//Draw the grid on the second buffer
  for (int i = 0; i<8; i++){
    for (int j = 0; j<8; j++){
      if (board[i][j]>0)draw_circle(i, j, numToColor(board[i][j]));}}

	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

	int prev_row_1 = 0;
	int prev_col_1 = 0;
	int prev_row_2 = 0;
	int prev_col_2 = 0;
	int holding = 0;
	//Detect key press
	int PS2_data, RVALID;
	char key;

    while (win == 0)
    {
		//Reading keyboard input
		key = 0x00;
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		if (RVALID && display == 1){
			key = PS2_data & 0xFF;
		}
		//Checking "holding" input
		if (holding == 0 && *sw_ptr == 1){	//if SW[0] is switched from off to on
			holding = board[curr_row][curr_col];
			if (valid_path[holding-1] == 1){	//the user clicked on a valid path (they want to erase it and make a new one)
				for (int i = 0; i < 8; i++){
					for (int j = 0; j < 8; j++){
						if (board[i][j] == (-1)*holding){
							draw_box(curr_row, curr_col, 0x0000);
							board[i][j] = 0;
						}
					}
				}
				valid_path[holding-1] = 0;
			}
		} else if (*sw_ptr == 0) {
			if (holding != 0 && valid_path[holding-1] == 0){
				for (int i = 0; i < 8; i++){
					for (int j = 0; j < 8; j++){
						if (board[i][j] == (-1)*holding){
							draw_box(curr_row, curr_col, 0x0000);
							board[i][j] = 0;
						}
					}
				}
			}
			holding = 0;
		}
		//Erase previous position
		if (display == 1){
			highlight_box(prev_row_1, prev_col_1, GREY);
		} else {
			highlight_box(prev_row_2, prev_col_2, GREY);
		}
		//Draw the current position
		if (holding != 0){
			int proposed_row = curr_row;	//The position that the user wants to move to
			int proposed_col = curr_col;	//Will be used to check for illegal moves
			update_position_keyboard(&proposed_row, &proposed_col, key);
			if (proposed_row - curr_row < -1 || proposed_row - curr_row > 1){	//The user can not 'overflow/underflow' the row to go from 1 -> 8
				//do nothing
				highlight_box(curr_row, curr_col, HIGHLIGHT);
			} else if (proposed_col - curr_col < -1 || proposed_col - curr_col > 1){ //The user can not 'overflow/underflow' the col to go from 1 -> 8
				//do nothing
				highlight_box(curr_row, curr_col, HIGHLIGHT);
			} else if (board[proposed_row][proposed_col] == 0 && valid_path[holding-1] == 0){	//empty gridspace, valid move
				curr_row = proposed_row;	//accept the proposed row
				curr_col = proposed_col;	//accept the proposed col
				highlight_box(curr_row, curr_col, HIGHLIGHT);
				board[curr_row][curr_col] = (-1) * holding;		//update the board
			} else if (board[proposed_row][proposed_col] == (-1)*holding && (curr_row != proposed_row || curr_col != proposed_col)){	//You move to a space with the colour you are already holding													 ^(usually used when you made a mistake and want to go back)
				board[curr_row][curr_col] = 0;		//update the board
				curr_row = proposed_row;	//accept the proposed row
				curr_col = proposed_col;	//accept the proposed col
				highlight_box(curr_row, curr_col, HIGHLIGHT);
			} else if (board[proposed_row][proposed_col] == holding){	//check for end of pipe
				int found = 0;
				for (int i = 0; i < 8; i++){
					for (int j = 0; j < 8; j++){
						if (board[i][j] == (-1)*holding){		//at least 1 filled box exists so its not the start of the pipe
							valid_path[holding-1] = 1;
							found = 1;
							break;
						}
					}
					if (found) break;
				}
				curr_row = proposed_row;	//accept the proposed row
				curr_col = proposed_col;	//accept the proposed col
				draw_box(curr_row, curr_col, numToColor(holding));	//fill in the square with the colour you are holding
				draw_circle(curr_row, curr_col, 0x0000);
				highlight_box(curr_row, curr_col, HIGHLIGHT);
			} else if (board[proposed_row][proposed_col] == (-1)*holding && curr_row == proposed_row && curr_col == proposed_col){
				highlight_box(curr_row, curr_col, HIGHLIGHT);
			}
		} else {
			update_position_keyboard(&curr_row, &curr_col, key);
			highlight_box(curr_row, curr_col, HIGHLIGHT);
		}


		//Draw the current board
		for (int i = 0; i < 8; i++){
			for (int j = 0; j < 8; j++){
				if (board[i][j] <= 0){
					short int colour = numToColor((-1)*board[i][j]);
					draw_box(i, j, colour);
				} else {
					if (valid_path[board[i][j]-1] == 0 && holding != board[i][j]){
						draw_box(i, j, 0x0000);
						draw_circle(i, j, numToColor(board[i][j]));
					}
				}
			}
		}

		//Update previous positions for erasing
		if (display == 1){
			prev_row_1 = curr_row;
			prev_col_1 = curr_col;
		} else {
			prev_row_2 = curr_row;
			prev_col_2 = curr_col;
		}
		display = display*(-1);

        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		int num_of_valid_paths = 0;
		for (int path = 0; path < 8; path++){
			if (valid_path[path] == 1){
				num_of_valid_paths++;
			} else {
				break;
			}
		}
		if (num_of_valid_paths == 8){
			win = 1;
		}
    }



	if (win){
		int y = 0;
        for (int k = 0; k < 320*240*2; k=k+2){
			int x = k/2 % 320;
			int y = k/2 / 320;
			int red = ((winscreen3_map[k + 1] & 0xF8) >> 3) << 11;
			int green = (((winscreen3_map[k] & 0xE0) >> 5)) | ((winscreen3_map[k+1] & 0x7) << 3);
			int blue = (winscreen3_map[k] & 0x1f);
			
			short int p = red | ((green << 5) | blue);
			plot_pixel(x, y, p);
		}
	}
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	while (1){;}
}

void draw_grid(){
	//Draw horizontal lines
	//9 lines, 3 pixels wide, 22 pixels apart
	for (int horiz_line = 32; horiz_line <= 208; horiz_line+=22){	// Each box is 17x17 (not including borders)
		for (int border_y = 0; border_y < 3; border_y++){
			for (int x = 72; x < 250; x++){
				plot_pixel(x, border_y+horiz_line, GREY);
			}
		}
	}
	//Draw vertical lines
	//9 lines, 3 pixels wide, 22 pixels apart
	for (int vert_line = 72; vert_line <= 248; vert_line+=22){	// Each box is 17x17 (not including borders)
		for (int border_x = 0; border_x < 3; border_x++){
			for (int y = 32; y < 210; y++){
				plot_pixel(border_x+vert_line, y, GREY);
			}
		}
	}
}

//Takes the row and column number (0-7)
void draw_box(int row_, int col_, short int colour){
	int col = 75 + (22 * col_);		//First column starts at 72 (+3 line width)
	int row = 35 + (22 * row_);		//First row starts at 32 (+3 line width)
								//Each subsequent row/col is 22 pixels further
	for (int x = 0; x < 19; x++){
		for (int y = 0; y < 19; y++){
			plot_pixel(x+col, y+row, colour);
		}
	}
}

void draw_circle(int row_, int col_, short int colour){
	int col = 84 + (22 * col_);		//Center of the circle at 75 (+9)
	int row = 44 + (22 * row_);		//Center of the circle at 35 (+9)

	plot_pixel(col, row, colour);	//Draw the center dot

	for (int x = 0; x < 5; x++){
		plot_pixel(col-2+x, row-4, colour);	//Draw the top of the circle
		plot_pixel(col-2+x, row+4, colour);	//Draw the bottom of the circle
	}
	for (int y = 0; y < 5; y++){
		plot_pixel(col-4, row-2+y, colour);	//Draw the left of the circle
		plot_pixel(col+4, row-2+y, colour);	//Draw the right of the circle
	}
	//Draw the corners of the circle
	plot_pixel(col-3, row-3, colour);
	plot_pixel(col+3, row-3, colour);
	plot_pixel(col-3, row+3, colour);
	plot_pixel(col+3, row+3, colour);

}

void highlight_box(int row_, int col_, short int colour){
	int col = 72 + (22 * col_);		//Top left coordinate of the column border
	int row = 32 + (22 * row_);		//Top left coordinate of the row border

	for (int x = 0; x < 25; x++){	//Each grid tile is 19x19 with a 3 pixel wide border (19+3+3=25)
		for (int y = 0; y < 3; y++){
			plot_pixel(col+x, row+y, colour);
			plot_pixel(col+x, row+22+y, colour);
		}
	}
	for (int y = 0; y < 25; y++){	//Each grid tile is 19x19 with a 3 pixel wide border (19+3+3=25)
		for (int x = 0; x < 3; x++){
			plot_pixel(col+x, row+y, colour);
			plot_pixel(col+22+x, row+y, colour);
		}
	}
}

void update_position(int* curr_row, int* curr_col){
	switch (key_pressed){
		case 0:	*curr_col = *curr_col + 1;	//Go right
			break;
		case 1: *curr_row = *curr_row + 1;	//Go down
			break;
		case 2: *curr_row = *curr_row - 1;	//Go up
			break;
		case 3: *curr_col = *curr_col - 1; 	//Go left
			break;
		default:;
	}
	key_pressed = 4;	//No key pressed

	if (*curr_row == 8){
		*curr_row = 0;
	} else if (*curr_row == -1){
		*curr_row = 7;
	}
	if (*curr_col == 8){
		*curr_col = 0;
	} else if (*curr_col == -1){
		*curr_col = 7;
	}
}

void update_position_keyboard(int* curr_row, int* curr_col, char key){
	switch (key){
		case 0x74:	*curr_col = *curr_col + 1;	//Go right
			break;
		case 0x72: *curr_row = *curr_row + 1;	//Go down
			break;
		case 0x75: *curr_row = *curr_row - 1;	//Go up
			break;
		case 0x6B: *curr_col = *curr_col - 1; 	//Go left
			break;
		default:;
	}

	if (*curr_row == 8){
		*curr_row = 0;
	} else if (*curr_row == -1){
		*curr_row = 7;
	}
	if (*curr_col == 8){
		*curr_col = 0;
	} else if (*curr_col == -1){
		*curr_col = 7;
	}
}

void clear_screen(){
	for (int x = 0; x < 320; ++x){
		for (int y = 0; y < 240; ++y){
			plot_pixel(x,y, 0x0000);
		}
	}
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void print_text(int x, int y, char* ptr) {
    int offset;
    volatile char* char_buffer = (char*)FPGA_CHAR_BASE;

    offset = (y << 7) + x;
    while(*ptr) {
        *(char_buffer + offset) = *ptr;
        ++ ptr;
        ++ offset;
    }
}

void wait_for_vsync() {
	volatile int * pixel_ctrl_ptr = (int*) 0xFF203020;
	register int status;

	*pixel_ctrl_ptr = 1;	//start the sync

	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0){
		status = *(pixel_ctrl_ptr + 3);		//wait for s to become 0
	}
}

void checkwin() { // game logic to check if game is over
  bool_won = 1;
  for (int j=0;j<8;j++) for (int i=0;i<8;i++) {
      int bool_found = 0;
      if (board[j][i]>0) {
        for (int m=0;m<8;m++) for (int k=0;k<8;k++){
          if (board[m][k]== -board[j][i]) bool_found = 1;
          if (bool_found ==0) bool_won = 0;
		}
    }
  }
  //if (bool_won)
  // display win message
  //printf("you win");
}

short int numToColor(int num) { // conversion to color
   switch(num){
          case 1: return RED;
       break;
          case 2: return BLU;
       break;
          case 3: return PUR;
       break;
          case 4: return YEL;
       break;
          case 5: return GRE;
       break;
          case 6: return PNK;
       break;
          case 7: return ORA;
       break;
          case 8: return TEA;
       break;
       default: return 0x0000;
       break;
   }
}

/*****************************************************************************
		Interupt Handling
******************************************************************************/
/* setup the KEY interrupts in the FPGA */
void config_KEYs()
{
	volatile int * KEY_ptr = (int *) 0xFF200050; // KEY base address
	*(KEY_ptr + 2) = 0xF; // enable interrupts for all four KEYs
}
/* This file:
* 1. defines exception vectors for the A9 processor
* 2. provides code that sets the IRQ mode stack, and that dis/enables
* interrupts
* 3. provides code that initializes the generic interrupt controller
*/
void pushbutton_ISR (void);
void config_interrupt (int, int);
// Define the IRQ exception handler
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
	// Read the ICCIAR from the CPU Interface in the GIC
	int interrupt_ID = *((int *) 0xFFFEC10C);
	if (interrupt_ID == 73) // check if interrupt is from the KEYs
	pushbutton_ISR ();
	else
	while (1); // if unexpected, then stay here
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int *) 0xFFFEC110) = interrupt_ID;
}
// Define the remaining exception handlers
void __attribute__ ((interrupt)) __cs3_reset (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_undef (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_swi (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_pabort (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_dabort (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_fiq (void)
{
	while(1);
}
/*
* Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts(void)
{
	int status = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}
/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void)
{
	int stack, mode;
	stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r" (stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
}
/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void)
{
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}
/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void)
{
	config_interrupt (73, 1); // configure the FPGA KEYs interrupt (73)
	// Set Interrupt Priority Mask Register (ICCPMR). Enable all priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set the enable in the CPU Interface Control Register (ICCICR)
	*((int *) 0xFFFEC100) = 1;
	// Set the enable in the Distributor Control Register (ICDDCR)
	*((int *) 0xFFFED000) = 1;
}
/*
* Configure registers in the GIC for an individual Interrupt ID. We
* configure only the Interrupt Set Enable Registers (ICDISERn) and
* Interrupt Processor Target Registers (ICDIPTRn). The default (reset)
* values are used for other registers in the GIC
*/
void config_interrupt (int N, int CPU_target)
{
	int reg_offset, index, value, address;
	/* Configure the Interrupt Set-Enable Registers (ICDISERn).
	* reg_offset = (integer_div(N / 32) * 4; value = 1 << (N mod 32) */
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
	/* Using the address and value, set the appropriate bit */
	*(int *)address |= value;
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
	* reg_offset = integer_div(N / 4) * 4; index = N mod 4 */
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Using the address and value, write to (only) the appropriate byte */
	*(char *)address = (char) CPU_target;
}

void pushbutton_ISR( void ){
	volatile int * KEY_ptr = (int *) 0xFF200050;
	int press;
	press = *(KEY_ptr + 3); 		// read the pushbutton interrupt register
	*(KEY_ptr + 3) = press; 	// clear the interrupt
	if (press & 0x1) 			// KEY0
		key_pressed = 0;  //global var
	else if (press & 0x2) 		// KEY1
		key_pressed = 1;
	else if (press & 0x4) 		// KEY2
		key_pressed = 2;
	else 						// press & 0x8, which is KEY3
		key_pressed = 3;
	return;
}

